import React, {Component} from 'react';
import {Drawer, Menu} from "antd";
import {withRouter} from "react-router";

class ToggleManagerView extends Component {

    toggelRouter = ({item, key, keyPath, domEvent}) => {
        console.log(item,key,keyPath);
        if (key==='dataView'){
            this.props.history.push('/manager/dataView');
        }
        if (key==='workSpace'){
            this.props.history.push('/manager/workSpace');
        }
    }

    render() {
        return (
            <Drawer visible={this.props.visible} placement='right' maskClosable={false} onClose={this.props.close}
                    bodyStyle={{padding: '0'}}>
                <Menu theme='dark' style={{height: '1426px'}} onClick={this.toggelRouter}>
                    <Menu.Item key='dataView'>数据视图</Menu.Item>
                    <Menu.Item key='workSpace'>工作台</Menu.Item>
                </Menu>
            </Drawer>
        );
    }
}

export default withRouter(ToggleManagerView);
